import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import NightsStayIcon from '@material-ui/icons/NightsStay';
import WbSunnyIcon from '@material-ui/icons/WbSunny';

function Navbar() {


    function moon() {
        document.body.classList.toggle("dark");
        let sun = document.getElementById("sun");
        let moons = document.getElementById("moon");
        moons.style.display = "none";
        sun.style.display = "flex";
    }
    function suns() {
        document.body.classList.toggle("dark");
        let sun = document.getElementById("sun");
        let moons = document.getElementById("moon");
        moons.style.display = "flex";
        sun.style.display = "none";
    }


    return (
        <>
            <div className="container">
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Home</Nav.Link>
                            <Nav.Link href="#link">Link</Nav.Link>
                            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                        <Form inline>
                            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                            <Button variant="outline-success">Search</Button>
                        </Form>
                    </Navbar.Collapse>
                </Navbar>
            </div>



            {/* <div className="menu">
                    <div className="logo">
                        <h2>ThapaTechnical</h2>
                    </div>
                    <div className="li">
                        <NavLink activeClassName="active" exact to="/">Home</NavLink>
                        <NavLink activeClassName="active" exact to="/service">Services</NavLink>
                        <NavLink activeClassName="active" exact to="/about">About</NavLink>
                        <NavLink activeClassName="active" exact to="/contact">Contact</NavLink>
                    </div>
                    <div onClick={moon} id="moon">
                        <NightsStayIcon />
                    </div>
                    <div style={{display:'none'}} id="sun" onClick={suns}>
                        <WbSunnyIcon />
                    </div>
                </div> */}
        </>
    )
}


export default Navbar;
